import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import { HomeContainer, HomeTitle, PostButton, AdCard } from "../styles/homeStyles";
import { MenuItem, Select, Button, Typography, CardContent, TextField, Pagination } from "@mui/material";

function Home() {
  const [items, setItems] = useState([]);
  const [filter, setFilter] = useState("");
  const [searchQuery, setSearchQuery] = useState("");
  const [page, setPage] = useState(1);
  const itemsPerPage = 5; // –ö–æ–ª–∏—á–µ—Å—Ç–≤–æ –æ–±—ä—è–≤–ª–µ–Ω–∏–π –Ω–∞ —Å—Ç—Ä–∞–Ω–∏—Ü–µ

  useEffect(() => {
    fetch("/items")
      .then((res) => res.json())
      .then((data) => setItems(data));
  }, []);

  const filteredItems = items
    .filter((item) => (filter ? item.type === filter : true)) // –§–∏–ª—å—Ç—Ä–∞—Ü–∏—è –ø–æ –∫–∞—Ç–µ–≥–æ—Ä–∏–∏
    .filter((item) => item.name.toLowerCase().includes(searchQuery.toLowerCase())); // –§–∏–ª—å—Ç—Ä–∞—Ü–∏—è –ø–æ –Ω–∞–∑–≤–∞–Ω–∏—é

  // –†–∞–∑–¥–µ–ª—è–µ–º –æ–±—ä—è–≤–ª–µ–Ω–∏—è –Ω–∞ —Å—Ç—Ä–∞–Ω–∏—Ü—ã
  const totalPages = Math.ceil(filteredItems.length / itemsPerPage);
  const displayedItems = filteredItems.slice((page - 1) * itemsPerPage, page * itemsPerPage);

  return (
    <HomeContainer>
      <HomeTitle variant="h4">–û–±—ä—è–≤–ª–µ–Ω–∏—è</HomeTitle>

      <div style={{ display: "flex", justifyContent: "space-between", marginBottom: 20 }}>
        <PostButton variant="contained" color="success" component={Link} to="/form">
          –†–∞–∑–º–µ—Å—Ç–∏—Ç—å –æ–±—ä—è–≤–ª–µ–Ω–∏–µ
        </PostButton>
      </div>

      {/* üîπ –ü–æ–ª–µ –ø–æ–∏—Å–∫–∞ */}
      <TextField
        fullWidth
        label="–ü–æ–∏—Å–∫ –ø–æ –Ω–∞–∑–≤–∞–Ω–∏—é"
        variant="outlined"
        value={searchQuery}
        onChange={(e) => setSearchQuery(e.target.value)}
        sx={{ marginBottom: 2 }}
      />

      {/* üîπ –§–∏–ª—å—Ç—Ä –ø–æ –∫–∞—Ç–µ–≥–æ—Ä–∏–∏ */}
      <Select fullWidth value={filter} onChange={(e) => setFilter(e.target.value)} displayEmpty>
        <MenuItem value="">–í—Å–µ –∫–∞—Ç–µ–≥–æ—Ä–∏–∏</MenuItem>
        <MenuItem value="–ù–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç—å">–ù–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç—å</MenuItem>
        <MenuItem value="–ê–≤—Ç–æ">–ê–≤—Ç–æ</MenuItem>
        <MenuItem value="–£—Å–ª—É–≥–∏">–£—Å–ª—É–≥–∏</MenuItem>
      </Select>

      {/* üîπ –í—ã–≤–æ–¥ –æ–±—ä—è–≤–ª–µ–Ω–∏–π —Ç–µ–∫—É—â–µ–π —Å—Ç—Ä–∞–Ω–∏—Ü—ã */}
      {displayedItems.map((item) => (
        <AdCard key={item.id}>
          <CardContent>
            <Typography variant="h6">{item.name}</Typography>
            <Typography color="text.secondary">{item.type}</Typography>
          </CardContent>
          <Button variant="contained" component={Link} to={`/item/${item.id}`}>
            –û—Ç–∫—Ä—ã—Ç—å
          </Button>
        </AdCard>
      ))}

      {/* üîπ –ü–∞–≥–∏–Ω–∞—Ü–∏—è */}
      {totalPages > 1 && (
        <Pagination
          count={totalPages}
          page={page}
          onChange={(_, value) => setPage(value)}
          sx={{ mt: 2, display: "flex", justifyContent: "center" }}
        />
      )}
    </HomeContainer>
  );
}

export default Home;
